import Count from "../components/Count";
import {Navigate} from "react-router-dom";
import Test from "../components/Test";

export default [
    {
        path:'/math',
        element:<Count/>
    },
    {
      path:'/test',
      element:<Test/>
    },
    {
        path: '/',
        element: <Navigate to="/math"/>
    }
]
